    public function getHistory($fetchOne, $date = '') {

        $fetchOne = is_object($fetchOne) ? (array)$fetchOne : $fetchOne;
        try {
            $code = isset($this->codes[$fetchOne['id']]) ? $this->codes[$fetchOne['id']] : 0;
            if (empty($code)) {
                Log::log("【api168168】{$fetchOne['name']} code is empty",Log::INFO,'SpiderService');
                return false;
            }
            Log::log($this->url."&code={$code}&date={$date}",Log::INFO,'SpiderService');
            $response = Common::curlRequest($this->url."date={$date}&lotCode={$code}");
//            $response = '{"errorCode":0,"message":"操作成功","result":{"businessCode":0,"message":"操作成功","data":[{"preDrawTime":"2024-07-21 12:20:00","preDrawIssue":20240721148,"preDrawCode":"06,01,07,02,03,10,04,05,09,08","sumFS":7,"sumBigSamll":1,"sumSingleDouble":0,"firstDT":1,"secondDT":1,"thirdDT":0,"fourthDT":1,"fifthDT":1,"groupCode":1},{"preDrawTime":"2024-07-21 12:15:00","preDrawIssue":20240721147,"preDrawCode":"08,01,05,09,02,03,04,06,10,07","sumFS":9,"sumBigSamll":1,"sumSingleDouble":0,"firstDT":0,"secondDT":1,"thirdDT":1,"fourthDT":0,"fifthDT":1,"groupCode":1}]}}';
//            $response = $this->response_simple;
//            $response = '{"errorCode":0,"message":"操作成功","result":{"businessCode":100001,"message":"输入参数为空.","data":[]}}';
            Log::log($response,Log::INFO,'SpiderService');
//            exit;
            $content = json_decode($response, true);
            if (empty($content)) {
//                Log::log($content,Log::INFO,'SpiderService');
                return false;
            }
            if(isset($content['result']['businessCode']) && $content['result']['businessCode'] != 0 ) {
//                Log::log($content,Log::INFO,'SpiderService');
                $msg = isset($content['result']['message']) ? $content['result']['message'] : '抓取彩果失败！';
                echo $msg . PHP_EOL;
                return false;
            }
            $this->_fetch($fetchOne, $content['result'], true);
            return true;
        } catch (\Exception $e) {
            Log::logException($e,'SpiderService','error');
            return false;
        } catch (\Error $e) {
            Log::logException($e,'SpiderService','error');
            return false;
        }
    }

